"""
Resource Manager for IITJP Package

This module handles the embedded audio resources, ensuring they're always available
regardless of installation method.
"""

import os
import sys
import base64
import tempfile
import atexit
import shutil
import importlib.util
import site
import warnings

# Base64-encoded audio files
# These are small MP3 files embedded directly in the code to ensure availability
EMBEDDED_RESOURCES = {
    "greeting.mp3": """""",
    "start_quiz.mp3": """""",
    "end_quiz.mp3": """""",
    "farewell.mp3": """"""
}

# Global cache of extracted files
EXTRACTED_FILES = {}
TEMP_DIRS = []

def get_package_dir():
    """Get the package installation directory"""
    try:
        spec = importlib.util.find_spec("iitjp")
        if spec and spec.origin:
            return os.path.dirname(spec.origin)
    except:
        pass
    return os.path.dirname(os.path.abspath(__file__))

def get_potential_data_dirs():
    """Get all potential directories where data files might be located"""
    package_dir = get_package_dir()
    dirs = [
        # Package locations
        os.path.join(package_dir, "data"),
        package_dir,
        os.path.join(os.path.dirname(package_dir), "data"),
        
        # Site-packages locations
        *[os.path.join(path, "iitjp", "data") for path in site.getsitepackages()],
        *[os.path.join(path, "data") for path in site.getsitepackages()],
        
        # Virtual env locations
        os.path.join(sys.prefix, "Lib", "site-packages", "iitjp", "data"),
        os.path.join(sys.prefix, "Lib", "site-packages", "data"),
        
        # Current working directory
        os.path.join(os.getcwd(), "data"),
        os.getcwd(),
        
        # Common install locations
        os.path.expanduser("~/.iitjp/data"),
    ]
    return dirs

def create_persistent_temp_dir():
    """Create a persistent temp directory that's not deleted at exit"""
    temp_root = os.path.join(tempfile.gettempdir(), "iitjp_resources")
    os.makedirs(temp_root, exist_ok=True)
    return temp_root

def get_resource_path(resource_name):
    """
    Get the path to a resource file, extracting it from embedded data if needed.
    
    This is the main function to use when trying to access audio files.
    """
    # First check if already extracted
    if resource_name in EXTRACTED_FILES and os.path.exists(EXTRACTED_FILES[resource_name]):
        return EXTRACTED_FILES[resource_name]
    
    # Check in all potential locations
    potential_dirs = get_potential_data_dirs()
    
    for directory in potential_dirs:
        path = os.path.join(directory, resource_name)
        if os.path.exists(path):
            print(f"[] Found resource at {path}")
            EXTRACTED_FILES[resource_name] = path
            return path
    
    # If not found, extract from embedded resources
    if resource_name in EMBEDDED_RESOURCES:
        try:
            # Create persistent directory for extracted files
            extract_dir = create_persistent_temp_dir()
            extracted_path = os.path.join(extract_dir, resource_name)
            
            # Skip extraction if file already exists
            if os.path.exists(extracted_path):
                EXTRACTED_FILES[resource_name] = extracted_path
                return extracted_path
            
            # Handle empty placeholders
            embedded_data = EMBEDDED_RESOURCES[resource_name].strip()
            if not embedded_data or embedded_data.startswith("#"):
                # Try to find the file from package data
                try:
                    # Look for the file in potential data locations
                    for src_dir in potential_dirs:
                        src_path = os.path.join(src_dir, resource_name)
                        if os.path.exists(src_path):
                            # Copy to all possible destinations to ensure it's found next time
                            ensure_resource_in_all_locations(src_path)
                            EXTRACTED_FILES[resource_name] = src_path
                            return src_path
                except Exception as e:
                    warnings.warn(f"Error finding resource {resource_name}: {e}")
            else:
                # Decode and write the embedded file
                with open(extracted_path, "wb") as f:
                    f.write(base64.b64decode(embedded_data))
                
                # Also try to copy to standard locations
                for directory in potential_dirs:
                    try:
                        os.makedirs(directory, exist_ok=True)
                        dest_path = os.path.join(directory, resource_name)
                        shutil.copy2(extracted_path, dest_path)
                    except:
                        pass
                
                EXTRACTED_FILES[resource_name] = extracted_path
                return extracted_path
        except Exception as e:
            warnings.warn(f"Error extracting resource {resource_name}: {e}")
    
    # Last resort: try to find the file anywhere in the site-packages
    try:
        for site_dir in site.getsitepackages():
            for root, _, files in os.walk(site_dir):
                if resource_name in files:
                    path = os.path.join(root, resource_name)
                    print(f"[] Found resource through deep search: {path}")
                    EXTRACTED_FILES[resource_name] = path
                    return path
    except Exception as e:
        warnings.warn(f"Error during deep search for {resource_name}: {e}")
    
    # If all fails, return None
    print(f"[] Resource {resource_name} not found in any location.")
    return None

def ensure_resource_in_all_locations(source_path):
    """Copy a resource file to all potential data directories"""
    if not os.path.exists(source_path):
        return
    
    filename = os.path.basename(source_path)
    
    for directory in get_potential_data_dirs():
        try:
            os.makedirs(directory, exist_ok=True)
            dest_path = os.path.join(directory, filename)
            
            # Skip if source and destination are the same
            if os.path.abspath(source_path) == os.path.abspath(dest_path):
                continue
                
            # Copy the file
            shutil.copy2(source_path, dest_path)
            print(f"[] Copied {filename} to {directory}")
        except Exception as e:
            # Silently continue on error
            pass

def preload_resources():
    """
    Preload all resources to ensure they're available.
    Should be called at startup.
    """
    for resource_name in EMBEDDED_RESOURCES.keys():
        path = get_resource_path(resource_name)
        if path:
            print(f"[] Preloaded resource: {resource_name}")
        else:
            print(f"[] Failed to preload resource: {resource_name}")

def cleanup():
    """Clean up temporary directories"""
    for temp_dir in TEMP_DIRS:
        try:
            if os.path.exists(temp_dir):
                shutil.rmtree(temp_dir)
        except:
            pass

# Register cleanup handler
atexit.register(cleanup) 